import React from "react"
import './App.css';

function App() {
  const [thingsItems, setThingsItems] = React.useState(["Thing 1","Thing 2"])

  const thingsList = thingsItems.map((item) => {
    return <p>{item}</p>
  })
  function change(){
    setThingsItems((prevValue)=> {
      return prevValue + `Thing ${prevValue.length}`
    })
  }
    return (
      <div>
        <button onClick={change}>Add item</button>
        {thingsList}
      </div>
    )
}

export default App;
